sources.styles/blocks/header.scss:
.header {

  background-size: cover;
  background-position: center;
  background-image: url(../images/photos/header.png);

  &__content {
    display: flex;
    flex-direction: column;
    justify-content: space-between;

    box-sizing: border-box;
    height: 100vh;
    padding: $headerTopPadding 20px;

    @include onDesktop {
      padding: $headerTopPadding 80px;
    }
  }

  &__title {
    font-size: 46px;
    line-height: 40px;
    font-weight: bold;
    color: #fff;
    letter-spacing: -1px;

    @include onDesktop {
      font-size: 80px;
      line-height: 80px;
      letter-spacing: -1.5px;
    }

    &::before {
      content: "";
      display: block;
      width: 40px;
      height: 2px;
      background-color: #fff;
      margin-bottom: 24px;
    }
  }

  &__call {
    text-decoration: none;
    position: relative;

    @include onDesktop {
      @include onDesktop {
        &::before {
          content: "+1 234 555-55-55";
          position: absolute;
          top: 50%;
          transform: translate(-100%, -50%);

          display: block;
          width: max-content;
          padding-right: 20px;

          font-weight: bold;
          font-size: 12px;
          line-height: 16px;
          color: #fff;
          text-transform: uppercase;
          letter-spacing: 2px;
          opacity: 0;
          pointer-events: none;

        }&:hover::before {
          opacity: 1;
          pointer-events: all;
        }
      }
    }
  }
}

